import { ChonGhe } from "../Types/BTDatVeType"

export const chonGheAction = (ghe) => {
    return {
        type: ChonGhe,
        payload: ghe
    }
}

export const huyGheAction = (ghe) => {
    return {
        type: ChonGhe,
        payload: ghe
    }
}
